function MenuItem({title, onclick, icon}) {
    
    const checkIcon = (icon, title) => {
        if(icon) {
            return (
                <>
                    {icon}
                    <p>{title}</p>
                </>
            )
        }
    }
    return (
        <div>{title}
            {checkIcon(icon, title)}
        </div>
     );
}

export default MenuItem;
